  true,\n\t\"url\": null,\n\t\"notes\": \"This raw data reflects readings from instruments
  mounted on or near a 82 meter meteorological tower located at the [National Wind
  Technology Center (NWTC)](http://www.nrel.gov/wind/ \"NWTC website\"), approximately
  5 miles south of Boulder, CO (specifically: 39.9107 N, 105.2348 W, datum WGS84).
  The base elevation at the site is 1,855 meters AMSL.rnrnThe dataset includes irrandiance
  information, such as global PSP (W/m2) and meteorological data, such as temperature,
  pressure, and wind speed and direction (at 2m, 5m, 10m, 20m, 50m, and 80m). Included
  here is a portion of the available data: from August 24, 2001 - March 10, 2011.
  A separate dataset is available for the period between [September 23, 1996 and August
  23, 2001](http://en.openei.org/datasets/dataset/raw_data_from_national_wind_technology_center_m2_tower__1996_-_2001_
  \"Dataset within OpenEI, 1996 - 2001\").rnrnThe [NWTC website](http://www.nrel.gov/midc/nwtc_m2/
  \"Website for M2 Tower data\") provides up to the day updates to this data, from
  as early as August 24, 2001 through yesterday, as well as [instrument specifications](http://www.nrel.gov/midc/nwtc_m2/
  \"NWTC M2 Instrument Descriptions\").\",\n\t\"license_title\": \"Creative Commons
